          </div>

    
  );
};
const Modal = props => {
  return ReactDOM.createPortal( <div className="ui dimmer modals visible active">
      <div className="ui standard modal visible active w-25 h-25 align-items-center">I am a Modal</div>
  </div>, document.getElementById("modal"));
};

export default Modal;
